(35394, '4E5B0C0B-B7F1-48A5-ACD6-6B4865DFD26B', 'Ok so my #accountably for this morning is to say I️’m sorry I️ couldn’t get to my feelings fast enough last night. And what came out was pettiness around dates. I️ do think dates matter and pacing for us is real, especially in the beginning. But I️’m sorry that I️ wasn’t generous and couldn’t get there fast enough.  That’s not who I️ want to be with you. I️ want to be generous and loving and give you space for expanding.', 'Nitzan', 'David', '2021-10-13T08:09:49.542402'),
(35395, '28DD6AD4-5FC1-46FF-8463-16BBB2288A3F', 'I️ just ask for you to help live into the spirit of what we set up and to keep an eye on timing and to tend to us and ensure we have dates on the calendar too, especially if you’re going to set up dates with others. It helps me feel like I️’m a priority while you’re planning with others. ', 'Nitzan', 'David', '2021-10-13T08:10:44.192822'),
(35396, '0EA8A7A1-FC07-4810-8332-5C0496A82E80', 'You don’t have to plan every date, but I️ do think your initiative matters when you’re also planning with others. It tells me you’re thinking about me first and ensuring we have time together before the calendar gets booked up with others. ', 'Nitzan', 'David', '2021-10-13T08:11:43.206220'),
(35397, 'E50E92D7-88F8-47E4-B679-39B7077E5028', 'I️ appreciate the love and sexts - they make me feel seen and heard ', 'Nitzan', 'David', '2021-10-13T08:12:35.114404'),
(35398, 'C5B0059B-5DCC-492C-BB6A-55454D0DEA94', 'And valued and appreciated ', 'Nitzan', 'David', '2021-10-13T08:12:39.143692'),
