(35558, '9D1F5C9B-4CFE-4668-B24B-832587257ABB', 'I feel agitated by the way we left things. My ask of you is that we go back to basics to have conversations without judgement. If we are going to engage in a sensitive conversation, we start with how we are feeling, or when selecting on an action say, “when you did or said x, it made me feel y.” When you reflected back how I responded to your question about my conversation with Ilse, it made me feel angry and defensive.', 'David', 'Nitzan', '2021-10-14T14:23:24.144000'),
