(35565, 'C79F6B5B-E8BA-4C4D-9F19-1B04D8F7F832', 'But I️ understand that I️ didn’t say what I️ needed and you can’t guess ', 'Nitzan', 'David', '2021-10-14T14:40:43.296186'),
(35566, '0E9BB16F-814E-42FC-8CFF-02B5C211593B', 'But I️ really wish you would try to help feel around with me as we move into a new space. I️ don’t know what the parameters are. ', 'Nitzan', 'David', '2021-10-14T14:41:28.438985'),
(35567, 'DBBA6911-7E78-43A4-8200-70B87EB00C02', 'And I️ don’t know what I️ need ', 'Nitzan', 'David', '2021-10-14T14:41:48.771837'),
(35568, '9DA05DAC-ED7D-42FC-B50D-68DEFF98692B', 'I️ just know this feels fast and a lot to take in in the way it’s unfolding ', 'Nitzan', 'David', '2021-10-14T14:42:20.951180'),
(35569, 'A5FCD23E-9C49-4BA2-8AF4-942722158057', 'I️ think I️ said a few times this week that 3 scheduled dates in 5 weeks feels like a lot ', 'Nitzan', 'David', '2021-10-14T14:42:40.830873'),
(35570, '96328E04-9B76-4E21-9C5D-30E7DAF82791', 'I️ am not judging you ', 'Nitzan', 'David', '2021-10-14T14:44:09.555920'),
(35571, 'F019E26A-92F1-47FD-BC41-CB1F9ACB89B7', 'But I️ do feel hurt ', 'Nitzan', 'David', '2021-10-14T14:44:23.336400'),
(35572, '8EC55480-7772-4B4F-8956-A677725B121D', 'I hear you and I’m sorry you feel hurt. I don’t want you to feel overwhelmed and we can slow down.', 'David', 'Nitzan', '2021-10-14T15:03:06.606000'),
(35573, 'EC04BE3F-819B-4068-A599-97494B927AF4', 'I also want to explore with you what scares you about having a girlfriend. I don’t want to hide or minimize and it is confusing to me what you want me to share and not share....so that you can trust me and feel confident.', 'David', 'Nitzan', '2021-10-14T15:08:37.209000'),
(35574, 'B90B6F93-69E2-4774-8234-98F69DB166F9', 'This is all new so it’s just impossible for me to know what and how it feels in each new day ', 'Nitzan', 'David', '2021-10-14T15:10:30.225774'),
(35575, 'D10E7EE0-3164-460E-B892-1C58E33FF033', 'When you had your first date with Elsa, you said you didn’t feel that connected and it had a lightness to it ', 'Nitzan', 'David', '2021-10-14T15:11:32.322966'),
(35576, 'B9D33B97-16C8-4716-90F4-3561ACA96E1A', 'But once we get to so many consistent dates, it just has a different quality to it and what was a week or two ago has changed ', 'Nitzan', 'David', '2021-10-14T15:11:57.535166'),
(35577, 'C2454C53-274F-48CF-B2BB-15ED9ED3C941', 'So as things change for you, they change for me ', 'Nitzan', 'David', '2021-10-14T15:12:06.168972'),
(35578, '1E4AACA9-A1AF-4602-8574-3E1ACA8751D2', 'And with each new stage, I️ need time to get comfortable ', 'Nitzan', 'David', '2021-10-14T15:12:15.668986'),
(35579, 'A478784C-7089-4C01-9220-27639C6C8D01', 'And to feel safe ', 'Nitzan', 'David', '2021-10-14T15:12:18.959068'),
(35580, '5DB9BF29-CFE7-4AC3-B3EB-1BC11EB25BC0', 'So the more honest you are, the better ', 'Nitzan', 'David', '2021-10-14T15:12:31.050001'),
(35581, 'F339EE31-2A61-4C35-A37D-30569ED3C1CB', 'And the more transparent you are the better ', 'Nitzan', 'David', '2021-10-14T15:12:38.078825'),
(35582, 'ED8D2BF5-4964-41FD-85D3-C65C5A2994C4', 'I’m trying hard not to be a complete nightmare of a partner while this all unfolds ', 'Nitzan', 'David', '2021-10-14T15:13:02.037724'),
(35583, '670157AE-FE07-4E01-B5EF-1B74DF7992E5', 'And I️ know I️’m bring so difficult ', 'Nitzan', 'David', '2021-10-14T15:13:15.077473'),
(35584, '6F69ACC0-B50E-4AB8-9FE3-90DD2ED9DC10', 'It’s just happening too fast for me ', 'Nitzan', 'David', '2021-10-14T15:13:22.537475'),
(35585, '88A1BE01-9CE3-4E7C-9BE3-E090F9AD215F', 'You tell me things are slow', 'Nitzan', 'David', '2021-10-14T15:13:38.297450'),
(35586, '23D71F64-166C-4BA2-B291-15AFBC5D4A76', 'But they feel fast ', 'Nitzan', 'David', '2021-10-14T15:13:42.515127'),
(35587, 'BA50C04F-4362-49ED-B573-E2BB95A40584', 'And that’s when I️ start worrying that your not saying all the things. Not because you want to lie or not tell the truth. But just because it’s also unfolding for you in real time and you don’t always know either. ', 'Nitzan', 'David', '2021-10-14T15:14:56.754027'),
(35588, '5E702813-0CA6-4CB1-8563-EA09D894B00F', 'I’ll be honest with you about what is happening and my experience so we can work through the feelings and adjust the cadence. Just say, “hey I’d like to check in with you....I’m feeling uncomfortable, or anxious,” or “I’m curious what is going on with you right now.” 10-12 months ago, I wouldn’t have been able to know how to respond to this....and probably would have felt threatened, defensive, and would have tried to hide. But I’m not there anymore. While I too have so much to learn .... I am committed to doing this work and doing it in a way that prioritizes us and is expansive rather than divisive. My heart is totally open....and is growing....thanks to you.', 'David', 'Nitzan', '2021-10-14T15:29:11.258000'),
(35589, '9F9935E4-BEE4-4CFE-99D6-15F877C53102', 'And I️ totally totally see that in you ', 'Nitzan', 'David', '2021-10-14T15:31:25.843430'),
(35590, '8A4103F5-2CC0-4AEE-A69A-AD70A96670AF', 'And it’s what makes me want to embark on this experiment ', 'Nitzan', 'David', '2021-10-14T15:31:34.920124'),
(35591, '17875F39-9F11-4925-9223-45904E2BFF6A', 'We can and will be stronger for it ', 'Nitzan', 'David', '2021-10-14T15:31:41.471639'),
(35592, 'B5BC0504-8CD5-4604-A34E-30D25FD96FFA', 'But the pacing needs to be slower so that I️ can catch up and get comfortable with each of the stages ', 'Nitzan', 'David', '2021-10-14T15:32:08.433657'),
(35593, '5EF49073-F004-416D-869A-E1FFD37F96BC', 'So thanks for leaning in and hearing me ', 'Nitzan', 'David', '2021-10-14T15:32:15.701832'),
(35594, '330EA602-C6B4-45CF-BEFF-412C9A5D896A', 'There may be a time where twice a month feels good ', 'Nitzan', 'David', '2021-10-14T15:32:25.810889'),
(35595, '84ECB312-07B6-46B0-8E43-CD37C0153C77', 'But for now, it’s too fast in the way that it’s unfolded for me ', 'Nitzan', 'David', '2021-10-14T15:32:37.554282'),
(35596, '6F43E98E-B978-44ED-942D-4FF3CC9955D7', 'I got it. I told Ilsa to take the 2nd off the calendar.', 'David', 'Nitzan', '2021-10-14T15:33:20.800000'),
(35597, '68A20454-2E44-4238-89F4-F4D30B8EF2DB', 'I️ couldn’t have known this before ', 'Nitzan', 'David', '2021-10-14T15:33:22.691499'),
(35598, '8E05741F-796B-4E1C-BBF2-532ECACD990F', 'But the three dates all at once just took me backwards ', 'Nitzan', 'David', '2021-10-14T15:33:40.011616'),
(35599, '3E1754C3-C14B-4D62-A10F-B8467C6BD7A3', 'So thanks for understanding ', 'Nitzan', 'David', '2021-10-14T15:33:45.040804'),
(35600, 'E5ADEAF6-666F-4CFF-9567-178A2EAFFDAF', 'sure....and I’m happy to talk more about what’s going on if helpful...but want to do it face to face and not over text.', 'David', 'Nitzan', '2021-10-14T15:35:21.044000'),
(35601, '1696E3FA-DE9E-46FB-BE30-113B1D3C7CF8', 'I️ am also hoping that on some level you can also feel into me and look for signs for when it’s uncomfortable ', 'Nitzan', 'David', '2021-10-14T15:37:33.501213'),
(35602, 'C4D18E63-3DF2-41C6-ADD4-A4A95BD5293E', 'And figure out how to peel back ', 'Nitzan', 'David', '2021-10-14T15:37:50.371287'),
(35603, '365A6F1B-0291-4061-B5FB-1D5C081CA78D', 'Without all of the mandates coming from me ', 'Nitzan', 'David', '2021-10-14T15:38:00.884226'),
(35604, '4C7C6206-C9FA-424E-8752-A8E54117BC28', 'Because we both need to try to lean in and be overly protective and cautious about the other ', 'Nitzan', 'David', '2021-10-14T15:38:35.755888'),
(35605, '29B0532C-D42E-4003-B9D4-526D2B72D553', 'So that it keeps feeling safe ', 'Nitzan', 'David', '2021-10-14T15:38:42.560356'),
(35606, '52130666-EF8F-4261-A1B0-AB75EDED9A33', 'It feels bad for me to be the one who holds you back ', 'Nitzan', 'David', '2021-10-14T15:39:11.373135'),
(35607, '6DC6F630-F6C7-45A6-85B9-D9E330785822', 'And that is part of the challenge for me too ', 'Nitzan', 'David', '2021-10-14T15:39:18.411148'),
(35608, '4ECC2B4B-8AC8-4271-A554-833CB1759EAC', 'I️ want you to be happy ', 'Nitzan', 'David', '2021-10-14T15:39:24.065154'),
(35609, '33DEB570-96C8-4DA0-9CCB-8BAF7C993DDF', 'And you seem happy when you are exploring ', 'Nitzan', 'David', '2021-10-14T15:39:31.356201'),
(35610, '63CA8A22-69CE-4895-9A9D-C22AA96AB51A', 'So that’s also a dynamic at play ', 'Nitzan', 'David', '2021-10-14T15:40:35.093214'),
(35611, 'B30EA1AC-39A1-4AB8-9F6E-6F40BB96A030', 'That makes me want to say yes ', 'Nitzan', 'David', '2021-10-14T15:40:42.426775'),
(35612, '080D5472-29B1-47EC-9A7E-40863792D691', 'But then I️ have a bad reaction ', 'Nitzan', 'David', '2021-10-14T15:40:50.179948'),
(35613, 'DBEEF331-EBF6-435C-9F3B-5705094C4A9E', 'So I️ need to work on that too ', 'Nitzan', 'David', '2021-10-14T15:40:59.376770'),
(35614, '11C3DEC2-35F1-4907-A117-1076BB020DD8', 'Check your email ', 'Nitzan', 'David', '2021-10-14T15:46:11.251321'),
(35615, '9E57B37B-C46D-4A06-AB8B-6C6E4ABF3749', 'There is a really sweet update from Ohds about what the kids were learning today that kinda has me in tears', 'Nitzan', 'David', '2021-10-14T15:46:32.218066'),
(35616, '246FC3BC-DE2A-4591-A324-6BA61BA3016B', 'I can feel into you more easily when we can stay in a connected space when discussing. It’s why keeping the guardrails for discussion I mentioned above are important right now. When you stop and start with how your feeling it triggers my empathy and desire to support and respond to your needs. When you start with your analytic brain, it can trigger me and the defensive voice starts to take the mic and .... we often end up backtracking into old ways of communicating.', 'David', 'Nitzan', '2021-10-14T15:47:37.027000'),
(35617, 'DF903627-0689-4BC4-8DD3-DAA452B8F0B8', 'I️ understand ', 'Nitzan', 'David', '2021-10-14T15:48:07.591926'),
(35618, '663F4620-4635-4923-B62C-A49DDC472F7E', 'But I️ don’t always know how I️ am feeling ', 'Nitzan', 'David', '2021-10-14T15:48:16.182849'),
(35619, 'D1AC47E2-049D-4F5A-971B-8B523B5B7F99', 'I️’m an external processor and I️ need to talk to understand ', 'Nitzan', 'David', '2021-10-14T15:48:26.113837'),
(35620, '6738ADE6-2C02-4410-BFAA-44464005D2C7', 'I️ know this is a better way to do this ', 'Nitzan', 'David', '2021-10-14T15:48:38.434803'),
(35621, '16774C40-F8B4-4425-8C7B-0D4CA1CC4AA6', 'I️ just don’t always have the ability to name all the feelings right away without allowing the things that bother me to surface ', 'Nitzan', 'David', '2021-10-14T15:49:22.495873'),
(35622, '5230EFD4-EE03-4327-B3D1-1C5FF39ACBA5', 'And I️ get that that comes across as attacking and counter productive ', 'Nitzan', 'David', '2021-10-14T15:49:34.637414'),
(35623, '35AA8F2B-8492-42DE-A942-5BF5AD42069B', 'In my experience, my body sends a signal that I’m feeling something....my head might get tight, or my face might crinkle up, or I feel a tingle sensation in my chest....and that is a cue to step back and observe in for a moment....I don’t catch it always yet....that is the practice and I’m a beginner.....pretty soon I can decipher want to dominant voice/part and feeling....and start from there.', 'David', 'Nitzan', '2021-10-14T15:54:24.654000'),
(35624, '9E4EE51F-3A9B-4BE4-B4BE-46BD0450A364', 'I️ guess a better way to say it is that I️ feel those things too but I️ don’t always know what the feeling is ', 'Nitzan', 'David', '2021-10-14T15:56:14.213571'),
(35625, 'D209ECCC-22C1-46CF-9320-974D4D24FC3F', 'I think the framework of being an external processor could be an incomplete view. The Extended Mind book gave me lots of food for thinking about this....our minds extend beyond our brains.', 'David', 'Nitzan', '2021-10-14T15:56:16.361000'),
(35626, 'C4D9898B-33F9-44B1-8767-759339243049', 'Yes.....this is a practice.', 'David', 'Nitzan', '2021-10-14T15:56:44.873000'),
(35627, '0342AE64-5E8D-48DE-BBAA-C32EBC4B2929', 'I don’t either.', 'David', 'Nitzan', '2021-10-14T15:57:21.490000'),
(35628, '36A256B3-FCB8-422A-B589-CC4D7EF720CC', 'MKP has helped.....every meeting. This is where we start.', 'David', 'Nitzan', '2021-10-14T15:57:46.655000'),
(35629, 'D6013939-9F4F-4535-B7F4-641B41C5AE9F', 'Appreciate that ', 'Nitzan', 'David', '2021-10-14T16:10:57.000531'),
(35630, 'A07902FD-E18B-43C2-B2D7-FFDDC6002955', 'I️ feel overwhelmed right now love ', 'Nitzan', 'David', '2021-10-14T16:11:07.151229'),
(35643, '95FCFFB3-19FF-47D5-A0F5-A88B60C38DA1', 'We will slow down...and I will hold you and we can work through together.', 'David', 'Nitzan', '2021-10-14T16:24:21.754000'),
(35653, '56939863-81E5-4F59-B9B8-D56B241C92FB', 'Love, just reflecting how I feel at the end of a hard day. I feel sad and ashamed. You asked for me to be tender and attentive to your feelings. I was wrapped up in my own excitement  and did not consider your needs as I would like to. Sometimes when I feel your emotions directed at me, it activates a defense and protective part....I shut down and get hard.... I put up a shield...and my empathetic, kind self moves to the back of the bus. I know there is work here for me....and I’ll engage with it head on.', 'David', 'Nitzan', '2021-10-14T21:23:00.669000'),
(35654, '23EE55B7-DA41-42B3-BE75-39427CF4C762', 'In MKP tonight we did some visioning work and I used as a time to refine my goals and mission statement. I’m still playing with it. Create a world of health through purposeful action and kindness. I missed the mark on an opportunity to be kind and caring when you needed it. I also realized that I didn’t articulate in my goal with you....as to how I want to show up.  Focus my energy and attention to building a loving, caring, connected, expansive partnership through an open heart, attentiveness, truthfulness when it feels scary, building deep friendships and community, taking pleasure in her pleasure, intellectual growth and coparenting as loving gardeners by doing the work:', 'David', 'Nitzan', '2021-10-14T21:26:41.591000'),
(35655, '78BE60BE-398E-4876-847F-06E4F3280477', 'Last.....this showed up in my mailbox just as I was signing off MKP....it just came out....and seems fitting. Her voice gives chills. Uncanny.', 'David', 'Nitzan', '2021-10-14T21:27:47.650000'),
(35656, 'E4CABC91-41F4-4A19-997B-6652A256BDD5', 'https://open.spotify.com/track/0gplL1WMoJ6iYaPgMCL0gX?si=e1569a8e420a40c7', 'David', 'Nitzan', '2021-10-14T21:28:03.577000'),
(35660, 'DDC22379-EB2A-4CB7-BF0A-58EDACE45D15', 'Sorry…can’t get the image of dancing naked you out of my head this am.  Makes me happy to see you happy after you get off the scale. ', 'David', 'Nitzan', '2021-10-15T08:08:29.597854'),
(35661, 'CA2793D2-A560-4753-B6E5-0648B4369A4D', 'So many journeys for us as we learn about ourselves and who we are. And we travel the world together. No one I️ want to be on this journey with more than you. To my daily blessing…lechi lach.', 'Nitzan', 'David', '2021-10-15T08:20:21.533259'),
(35662, '249EBB28-06D2-4C5C-8D24-00434DB2632D', 'https://open.spotify.com/track/6FZ9fxsz55M0NXophQwJAW?si=9_wEknhyRa6vTvDAEkX71g', 'Nitzan', 'David', '2021-10-15T08:20:25.478164'),
(35666, '0F62EBAA-BD66-44F1-A1B4-E928C3262875', 'Thanks for sharing. If you want to learn how to song/play…I’d prefer to hear your voice! ', 'David', 'Nitzan', '2021-10-15T09:48:28.089272'),
(35667, '46B3B852-217E-4BF0-9697-7BE0A0AD501B', 'Can we plan some 1:1 time this weekend…just to sit and read and snuggle together or a hike? ', 'David', 'Nitzan', '2021-10-15T09:50:32.975775'),
