(35671, '251DCDAC-D933-4315-8066-01574B4DA767', 'And would love for you to learn the song on the guitar! ', 'Nitzan', 'David', '2021-10-15T11:52:04.838043'),
(35672, '50D1FA08-DD31-46FD-AD83-D393B17DCE7F', 'And yes for this weekend! The question is when? ', 'Nitzan', 'David', '2021-10-15T11:52:22.947972'),
